import React from "react";


function Launch(){
    return(
        <div className="launchButtonsContainer">
            <img 
                src="https://www.nasa.gov/sites/default/files/styles/image_card_4x3_ratio/public/thumbnails/image/hubble_ngc1705_potw2205a.jpg" 
                alt="space" 
                className="launchSpaceImg"
            />
            <button className="launchButtons">Old Launches</button>
            <button className="launchButtons">Upcoming Launches</button>
        </div>
    )
}

export default Launch
